DROP DATABASE IF EXISTS restaurant;
CREATE DATABASE restaurant;
USE restaurant;


-- CREATE TABLES --

CREATE TABLE `personnes` (
  `id` bigint(20) unsigned NOT NULL auto_increment,
  `nom` varchar(50) default NULL,
  `prenom` varchar(50) default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

CREATE TABLE `clients` (
  `id` bigint(20) unsigned NOT NULL auto_increment,
  `argent` varchar(10) default NULL,
  `id_personne` bigint default NULL,
  PRIMARY KEY (`id`),
  FOREIGN KEY (`id_personne`) REFERENCES `personnes`(`id`)
) AUTO_INCREMENT=1;

CREATE TABLE `employes` (
  `id` bigint(20) unsigned NOT NULL auto_increment,
  `num_badge` bigint default NULL,
  `id_personne` bigint default NULL,
  PRIMARY KEY (`id`),
  FOREIGN KEY (`id_personne`) REFERENCES `personnes`(`id`)
) AUTO_INCREMENT=1;

CREATE TABLE `serveurs` (
  `id` bigint(20) unsigned NOT NULL auto_increment,
  `couleur_blouse` varchar(25) default NULL,
  `id_employe` bigint default NULL,
  PRIMARY KEY (`id`),
  FOREIGN KEY (`id_employe`) REFERENCES `employes`(`id`)
) AUTO_INCREMENT=1;

CREATE TABLE `cuisiniers` (
  `id` bigint(20) unsigned NOT NULL auto_increment,
  `couleur_toque` varchar(25) default NULL,
  `id_employe` bigint default NULL,
  PRIMARY KEY (`id`),
  FOREIGN KEY (`id_employe`) REFERENCES `employes`(`id`)
) AUTO_INCREMENT=1;

CREATE TABLE `commandes` (
  `id` bigint(20) unsigned NOT NULL auto_increment,
  `date_prise` varchar(255),
  `date_livre` varchar(255),
  `id_client` bigint default NULL,
  `id_salle` bigint default NULL,
  PRIMARY KEY (`id`),
  FOREIGN KEY (`id_client`) REFERENCES `clients`(`id`),
  FOREIGN KEY (`id_salle`) REFERENCES `salles`(`id`)
) AUTO_INCREMENT=1;

CREATE TABLE `menus` (
  `id` bigint(20) unsigned NOT NULL auto_increment,
  `nom` varchar(25) default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

CREATE TABLE `nourriture` (
  `id` bigint(20) unsigned NOT NULL auto_increment,
  `nom` varchar(25) default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

CREATE TABLE `pieces` (
  `id` bigint(20) unsigned NOT NULL auto_increment,
  `nom` varchar(25) default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

CREATE TABLE `salles` (
  `id` bigint(20) unsigned NOT NULL auto_increment,
  `place` bigint default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

CREATE TABLE `cuisines` (
  `id` bigint(20) unsigned NOT NULL auto_increment,
  `dernier_audit` varchar(255),
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

CREATE TABLE `contient` (
  `id_menu` bigint default NULL,
  `id_nourriture` bigint default NULL,
  FOREIGN KEY (`id_menu`) REFERENCES `menus`(`id`),
  FOREIGN KEY (`id_nourriture`) REFERENCES `nourriture`(`id`)
) AUTO_INCREMENT=1;


